package name.zeno.android.third.alipayclass AlipayResult(rawResult: Map<String, String>?) {  /**   * alipay 错误码  [com.alipay.sdk.app.i]   */  var resultStatus: Int = 0    private set  var result: String? = null    private set  var memo: String? = null    private set  init {    if (rawResult != null) {      this.resultStatus = Integer.valueOf(rawResult["resultStatus"])!!      this.result = rawResult["result"]      this.memo = rawResult["memo"]    }  }}